import React, {Component} from "react";
import Table from "./Table";

class Tblu extends Component {
    constructor(){
        super()
        this.state = {
            // elem : {}
            ID: 1,
            Photo: "",
            FirstName: "",
            LastName: "",
            height: ""
        }
    }
    componentDidMount(){
        fetch('http://localhost:5000/GET',{
            'methods':'GET',
            headers : {
              'Content-Type':'application/json'
            }
        })
        .then(response => response.json())
        .then(data => {
            data.map( result => {
                this.setState({
                    Photo: result.thumbnail,
                    FirstName: result.FirstName,
                    LastName: result.LastName,
                    height: result.height
                });
            })
        })

          .catch(error => console.log(error))

        }


    render() {
        return (
            <table class="table">
            <tr > 
                <th>ID</th>
                <th>Photo</th>
                <th>FirstName</th>
                <th>LastName</th>
                <th>height</th>
                <th>Delete</th>
            </tr>
            {console.log(this.state.FirstName)}

            <Table thumbnail={this.state.Photo} FirstName={this.state.FirstName} LastName={this.state.LastName} height={this.state.height} deleteMe={this.deleteMe}/>
            </table>
        )
    }

}

export default Tblu
